import React, { Component } from 'react'

export default class Cart extends Component {
    state = {
        products: null
    }
    componentDidMount() {
        let products = JSON.parse(localStorage.getItem('products'));
        this.setState(products);
    }
    render() {
        return (
            <div className="cart">
            </div>
        )
    }
}
